/* eslint-disable */

function addAvenirNextLTProBoldFont(jsPDFAPI) {
  var font = '';
  var callAddFont = function() {
    this.addFileToVFS('AvenirNextLTProBold.ttf', font);
    this.addFont('AvenirNextLTProBold.ttf', 'avenir', 'bold');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}

export default addAvenirNextLTProBoldFont;
